(60, 'L Espace Tours ', 'Av. Paulista, 1079- 2nd floor', 'Sao Paulo', '01311-200', 'BRA', 'http://www.lespacetours.com.br', '5511999200313', '5511999200313', 'MS', 'Monica dos Santos', 'Director of Operations & Marketing', 'monica@lespacetours.com.br', '2;5;8;11;13', '2;3;6;7;9;10;16;19', '1', '1', 0, 100, '1', '5', 'Abercrombie & Kents', 'Trails of Indochina', 'Indochina Strings', '', '', 'IDN', 'THA', 'VNM', 'MDV', 'AUS', 'LKA', 'PNG', 'COK', 'THA', 'PHL', 'We are a team of passionate people about travels and exclusive experiences. Since 2005 we have being designing the most fantastic tailor-made journeys \r\naround the globe always focusing on the details aiming special memories. \r\n\r\nTo travel is, definitely, more than just visit new places. It’s to enjoy what happens to our soul when we do it.\r\n\r\nThe agency was created in 2005 from the mutual desire of showing the world to other people that love to travel, just like us. We understand that this is a \r\nprivilege and this is the reason why we work so hard, with professionalism and integrity.\r\n\r\nWe invite our clients to travel the world with us and to collect memories that can’t be found in post cards.', '$2y$10$OavA.0CjfK7TNksvXQdDEO2XxUfof6XuWekyADDvN3ypB0NG3rPM2', 'img/buyer/avatar-b84b0a4163c6e942e8464341c34ed8b8-fotoperfil-profissional-jpg', 'N'),
