(62, 'FMalta', 'Brazil', 'Sao Paulo', '55', 'BRA', 'http://www.fmalta.com.br', '+5511995911676', '', 'MR', 'Marcelo Spencer', 'COO', 'marcelo_spencer@hotmail.com', '1;2;3;11;14', '1;3;19', '1', '2', 10, 10, '2', '1', '', '', '', '', '', 'AFG', 'AFG', 'AFG', 'THA', 'AFG', 'AFG', 'AFG', 'AFG', 'THA', 'AFG', '', '$2y$10$pwl9KMz0tsaNKBThlnjwdOsj4E/nWf/OWkm/3bzr/VufMTrVkwLQy', 'img/buyer/no_photo.png', 'N'),
(63, 'Programa de Viagem', 'Rua Guararapes, 78', 'São Paulo', '04561000', 'BRA', 'https://www.programadeviagem.com/', '11999008012', '', 'MR', 'Marcel Takeshita', 'Diretor', 'marcel@programadeviagem.com.br', '16;17', '1;2;5;6;9;12;20;22', '1', '1', 0, 0, '1', '1', '', '', '', '', '', 'AFG', 'AFG', 'AFG', 'THA', 'AFG', 'AFG', 'AFG', 'AFG', 'THA', 'AFG', 'O Programa de Viagem é uma excelente opção para quem deseja conhecer e vivenciar destinos incríveis e sensacionais para se visitar. Aqueles que, como \r\nnós, amam descobrir novos lugares, experimentar sua comida tradicional, conhecer as particularidades da cultura local. \r\n\r\nCom uma excelente fotografia e narração, é praticamente um documentário, muito bem realizado e que explora a fundo, cada uma das particularidades \r\nexistentes nos locais visitados, fazendo com que o visitante se inspire e se sinta inserido na cultura e arte da região que decidir visitar. \r\n\r\nO programa é recheado de dicas ao viajante, que vão desde onde encontrar um bom prato típico, o que fazer, onde ir, passando é claro, pelo principal foco: \r\nos roteiros de viagem.\r\n\r\nSão as emoções e as experiencias que levamos para toda a vida.', '$2y$10$cEYso7yaXqJYloxRv8c6c.1IUH.oo0pLONBXN3OjWgmVJgVbujdPG', 'img/buyer/no_photo.png', 'N'),
