(463, 'Gemma Viagens', 'Rua dos Guajajaras 410, 304 - Centro', 'Belo Horizonte', '30180912', 'BRA', 'https://www.gemmatur.com.br/', '+5531987252593', '+553135074386', 'MS', 'Isabela Caillaux', 'Travel Consultant ', 'isabela.caillaux@gemmatur.com.br', '2;3;5', '1;2;3;5;6;7;10;13;15;16;17;18;19;20', '4', '1', 15, 85, '2', '5', 'JAL', 'ANA', 'AIR CHINA', 'Destination Asia', 'Creative Travel', 'JPN', 'CHN', 'AUS', 'NZL', 'MDV', 'THA', 'SGP', 'PYF', 'LKA', 'VNM', 'Ética, qualidade e confiança. Estes são os princípios básicos que norteiam a Gemma Viagens desde 2001.\r\nContamos com uma equipe formada por diversos profissionais altamente qualificados, experientes e comprometidos com nossa premissa e em oferecer \r\nsoluções para as suas viagens.\r\nAtuamos junto a clientes de setores como mineração, metalurgia, celulose, meio ambiente, saúde, entre outros, além da expertise no atendimento à \r\nempresas japonesas o que nos garante aprimoramento contínuo de nossos serviços e comprovada experiência.\r\nNossa rede de fornecedores é composta pelas principais empresas do ramo do turismo de negócios, tanto no Brasil quanto no exterior e, assim, \r\nconseguimos oferecer competitividade junto a diversos parceiros, garantindo a melhor tríade: preço, qualidade e segurança.', '$2y$10$NtyeOrdtXBLISvlYGUy0CuDF25S2M7E15k0MX7SOLgB56rP79YwwK', 'img/buyers/no_photo.png', 'N'),
